import type { Organ } from "./types/api.types";

async function openConfig(): Promise<void> {
    if (import.meta.env.VITE_UI_ONLY !== "true") {
        await window.pywebview.api.open_config();
    }
}

async function getOrgansList(): Promise<Organ[]> {
    if (import.meta.env.VITE_UI_ONLY === "true") {
        const data = [];
        for (let i = 0; i < 20; i++) {
            data.push({
                id: `organ-${i.toString()}`,
                name: "NDTJ",
                creator: "Debierre",
                date: 1850,
            });
        }
        return data;
    } else {
        return await window.pywebview.api.get_all_organs();
    }
}

async function getCover(organId: string): Promise<string> {
    if (import.meta.env.VITE_UI_ONLY === "true") {
        return "data:image;base64,";
    } else {
        return `data:image;base64,${await window.pywebview.api.get_organ_cover_b64(organId)}`;
    }
}

async function getPreview(organId: string): Promise<string> {
    if (import.meta.env.VITE_UI_ONLY === "true") {
        return "data:image;base64,";
    } else {
        return `data:image;base64,${await window.pywebview.api.get_organ_preview_b64(organId)}`;
    }
}

async function reloadOrgans(): Promise<void> {
    if (import.meta.env.VITE_UI_ONLY !== "true") {
        await window.pywebview.api.reload_organs_list();
    }
}

export { openConfig, getOrgansList, getCover, getPreview, reloadOrgans };
